import mongoose from "mongoose";

type IAddress = {
    line1?: string;
    line2?: string;
};

type IUser = {
    name: string;
    email: string;
    password: string;
    image: string;
    address: IAddress;
    gender:string,
    dob:string,
    phoneNumber:string
};

const addressSchema = new mongoose.Schema<IAddress>(
    {
        line1: { 
            type: String
        },
        line2: { 
            type: String 
        },
    },
    { _id: false }
);

const userSchema = new mongoose.Schema<IUser>(
    {
        name: {
            type: String,
            required: true,
        },
        email:{ 
            type: String,
            required: true, 
            unique: true 
        },
        password: { 
            type: String,
            required: true 
        },
        image: { 
            type: String,
            default:"data:image/jpeg;base64,"
        },
        address: { 
            type: addressSchema,
        },
        gender:{
            type:String,
            default:"Not Selected"
        },
        dob:{
            type:String,
            default:"Not Selected"
        },
        phoneNumber:{
            type:String,
            default:"990000000"
        }
    },
    
);

const userModel = mongoose.models.User || mongoose.model<IUser>("User", userSchema);
export default userModel;